import React from 'react';

function License() {
  const servers = [
    { id: 1, name: "Server 1", licenseExpires: "2024-07-10", daysLeft: 7 },
    { id: 2, name: "Server 2", licenseExpires: null, daysLeft: 0 }
  ];

  return (
    <div className="page">
      <h1>License</h1>
      <form>
        <label>
          License Key:
          <input type="text" name="licenseKey" />
        </label>
        <button type="submit">Activate</button>
      </form>
      <h2>Servers</h2>
      <ul>
        {servers.map(server => (
          <li key={server.id}>
            {server.name}
            {server.licenseExpires ? (
              <span> - License expires on {server.licenseExpires} ({server.daysLeft} days left)</span>
            ) : (
              <span> - No license</span>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default License;
